import { Col, Row, Form, Input, Button } from 'antd'
import React, { Component } from 'react'
import Footer from '../footer/Footer'
import Header from '../header/Header'

//设置填空选项的样式和提交按钮的样式
const layout = { labelCol: { span: 6 }, wrapperCol: { span: 12 }, };
const tailLayout = { wrapperCol: { offset: 6, span: 12 }, };
//定义提交的反馈（暂时打印出结果）
const onFinish = values => { console.log('Success:', values); };
//定义提交失败的反馈
const onFinishFailed = errorInfo => { console.log('Failed:', errorInfo); };

class MailDetail extends Component {
    render() {
        return (
            <div>
                <Header />
                <Row>
                    <Col span={16} offset={4} style={{ marginTop: 100 }}>
                        <Form {...layout} name="basic" onFinish={onFinish} onFinishFailed={onFinishFailed}>
                            <Form.Item label="单位" name="department" rules={[{ required: true, message: '选择单位' }]}>
                                <Input />
                            </Form.Item>

                            <Form.Item label="主题" name="title"
                                rules={[{ required: true, message: '请输入内容' }]}
                            >
                                <Input />
                            </Form.Item>


                            <Form.Item {...tailLayout}> <Button block type="primary" htmlType="submit">提交</Button> </Form.Item>
                        </Form>

                    </Col>
                </Row>
                <Footer />
            </div>
        )
    }
}
export default MailDetail;
